import React from "react";
import { View, Text, StyleSheet } from "react-native";
import { MaterialIcons } from '@expo/vector-icons'; 

export default function PostsScreen() {
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.title}>Публикации <MaterialIcons 
        name="logout" size={24} 
        style={styles.logout}/></Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    width: 375,
    maxHeight: 812,
  },
  header: {
    padding: 11,
    borderBottomWidth: 1,
    borderColor: "#c3c3c3",
  },
  logout:{
    color: "#c3c3c3",
    marginTop: 5,
  },
  title:{
    textAlign: "center",
    color: "#212121",
    fontWeight: 500,
    fontSize: 17,
    lineHeight: 22,
  }
});
